A tiny C language development environment, support project management and header file reference, support code executing.

For Coding enthusiasts and Computer-Science students, some Data-Structure projects are included.

You can use the tiny environment provided to run your project locally, or you can export the project to your computer to compile and run the project. The tiny environment includes a small C standard library that supports commonly used header files and most standard C99 library functions, and C Code Develop provides a easy access header file ccd.h, also some C++ features like argument reference, iostream(cin and cout) are supported. For safety reasons, inline assembly and some other unsafe syntax are not supported.

*1. Editor Support auto completion, auto format, long-press to document and other efficient features.
*2. Terminal (stdin and stdout) is fully supported, and also you can open *.txt file in project use fopen(), because of the app now only support view and edit text file, you can't open file without .txt suffix or other suffix, or use binary (b) as open mode is not currently supported.

Hello everyone! We present you a powerful tool for analyzing and viewing HTML, XML, JavaScript, CSS, JSON, RSS and ATOM code, which will provide you with the following great features:

• work with the application on three types of devices iPhone, iPad and Mac;
• view and analyze formatted HTML, XML, JSON, RSS and ATOM code in structured and text form;
• view the log of detected errors in the structure of HTML, XML, JSON, RSS and ATOM code;
• view the web page in the built-in simulator;
• change the size of the simulator to preset or set manually;
• test a web page using a terminal for entering Javascript code;
• view the connected styles for the selected element of the web page in code or in the simulator;
• get a list of files connected to a web page or to a CSS file;
• view the formatted content of JavaScript, CSS and JSON files connected to the web page;
• view all known image formats added to a web page or to a CSS file;
• open links that are available in the code;
• search by text or using regular expressions in the code or in the simulator;
• view formatted JavaScript, CSS, XML, JSON, RSS and ATOM code received separately upon request;
• open and view the formatted content of files on the device's storage;
• create unique requests with support for method input, Headers, Cookies and Body;
• view the cookie values ​​from the request response;
• change UserAgent values ​​for requests;
• view, edit or re-execute queries that were made earlier;
• copy to the clipboard all the code, individual sections or generated code from all child elements of the selected element of the code structure;
• copy to the clipboard any displayed information contained in the application panels;
• view the time spent on the execution of the request;
• change the formatting parameters of the code;
• change the user interface to your taste;
• change the font in any work area;
• use hot keys when working with an external keyboard.

